import React, { Component } from 'react';
import './table.css';
import Axios from 'axios';
// import { get } from 'https';
export default class Menu extends Component {
    constructor(props) {
        super(props);
        this.bindData = this.bindData.bind(this);
        this.state = {
            orders: {
                name: '',
                quantity: '',
                created: '',
                predicted: '',
                status: '',
            },
            data:[],
        }
    }

    componentDidMount() {
        this.bindData();
    }

    bindData() {
        Axios({
            method: "get",
            url: 'http://localhost:8088/getData',
            responseType: "json"

        }).then((response) => {
            console.log(response.data)

            this.setState({
                data:response.data
            })
        })
    }
    render() {

            let tbody = this.state.data.map((element)=>{
                return (
                    <tr>
                    <td>{element.name}</td>
                    <td>{element.quantity}</td>
                    <td>{element.created}</td>
                    <td>{element.predicted}</td>
                    <td>{element.status}</td>
                  </tr>
                )
            })


        return (
            <React.Fragment>
                <h2>Orders</h2>

                <table>
                    <thead>
                    <tr>
                        <th>Name</th>
                        <th>Quantity</th>
                        <th>Created</th>
                        <th>Predicted</th>
                    </tr>
                    </thead>
                    <tbody>
                            {tbody}
                    </tbody>
                </table>
            </React.Fragment>
        )
    }

}
